Mmenu.addons.navbars.close=function(t){var e=jQuery('<a class="mm-btn mm-btn_close mm-navbar__btn" href="#" />').appendTo(t);this.bind("setPage:after",function(t){e.attr("href","#"+t.attr("id"))}),this.bind("setPage:after:sr-text",function(t){e.html(Mmenu.sr_text(this.i18n(this.conf.screenReader.text.closeMenu))),Mmenu.sr_aria(e,"owns",e.attr("href").slice(1))})};